export const USER_PROFILE_ABI = [
    {
      name: 'createProfile',
      inputs: [
        { name: '_name', type: 'string' },
        { name: '_contactInfo', type: 'string' },
        { name: '_socialLinks', type: 'string' }
      ],
      outputs: [],
      stateMutability: 'nonpayable',
      type: 'function'
    },
    {
      name: 'getUserSkills',
      inputs: [{ name: 'user', type: 'address' }],
      outputs: [{ name: '', type: 'string[]' }],
      stateMutability: 'view',
      type: 'function'
    },
    {
      name: 'getAllUserProfiles',
      inputs: [],
      outputs: [
        {
          components: [
            { name: 'name', type: 'string' },
            { name: 'contactInformation', type: 'string' },
            { name: 'socialLinks', type: 'string' },
            { name: 'userProfileAddress', type: 'address' }
          ],
          type: 'tuple[]'
        }
      ],
      stateMutability: 'view',
      type: 'function'
    },
    {
      name: 'getUserSkillRatings',
      inputs: [{ name: '_userProfileAddress', type: 'address' }],
      outputs: [
        {
          components: [
            { name: 'user', type: 'address' },
            { name: 'skillName', type: 'string' },
            { name: 'rating', type: 'uint8' },
            { name: 'comment', type: 'string' }
          ],
          type: 'tuple[]'
        }
      ],
      stateMutability: 'view',
      type: 'function'
    },
    {
      name: 'rateSkill',
      inputs: [
        { name: '_skillName', type: 'string' },
        { name: '_rating', type: 'uint8' },
        { name: '_comment', type: 'string' },
        { name: 'targetUser', type: 'address' }
      ],
      outputs: [],
      stateMutability: 'nonpayable',
      type: 'function'
    }
  ];
